import React from "react";

const Follower = (follower) => {
  const { id, businessRecipient, imageUrl} = follower;
  return (
    <article className="card">
      <img src={imageUrl} alt={id} />
      <h4> ID: {id}</h4>
      <h4> Business Recipient: {businessRecipient}</h4>
      <h4> Forward: {id}</h4>
      <h4> From: {id}</h4>
      <h4> Individual Recipient: {id}</h4>
      <h4> Scan: {id}</h4>
      <h4> Timestamp: {id}</h4>

    </article>
  );
};

export default Follower;
